import React, { Component } from 'react';

class FooterComponent extends Component {
    render() {
        return (
            <div>
                <footer className="footer">
                    <span className="text-muted">All Rights Reserved 2023 @ChielokaCodes</span>
                </footer>
            </div>
        );
    }
}

export default FooterComponent;
